function name(namefn) {
  var text = linear_extrude(
    { height: 1.2 },
    namefn().scale(0.2)
  ).translate([15, 12, 1.8]);
  return text;
}

function imperial() {
  var innerMid = empireInnerMid(),
      borderRadius = 73,
      bounds = circle({r: borderRadius, fn: 128}).translate([-2, -144, 0]),
      border = bounds
        .subtract(
          circle({r: borderRadius - 4, fn: 128})
            .translate([2, -140, 0])
        ),
      icon = innerMid.union(border),
      inverted = bounds.subtract(icon);

  return inverted;
}

function faction(factionfn) {
  var factionIcon = factionfn().scale(0.075),
  fudgeX = 0,
  fudgeY = 0;
  if (factionfn == scum) {
    fudgeX = -0.7;
    fudgeY = 0.5;
  }
  return linear_extrude({ height: 1.2 }, factionIcon)
    .translate([2 + fudgeX, 11.3 + fudgeY, 1.8]);
}

function notch(range) {
  return linear_extrude({ height: 1 }, square({ size: [1, 12], center: false}))
    .translate([(range * 100) - 1, 0, 2]);
}

function wedge(range) {
  return linear_extrude({ height: 2 }, square({ size: [11, 12], center: false}))
    .rotateY(5)
    .translate([(range * 100) - 11, 0, 2.8]);
}

function sideWedge(range) {
  return linear_extrude({ height: 2 }, square({ size: [11, 12], center: false}))
    .rotateY(5)
    .rotateX(-90)
    .translate([(range * 100) - 11, 12, 10]);
}

function tidyEnd() {
  return cube({ size: [1, 12, 1] })
    .rotateY(5)
    .translate([299.9, 0, 1.845]);
}

function rangeNumber(range) {
  var shape = null;
  var centreOffset = 0;
  if (range == 1) {
    shape = one();
    centreOffset = 1.1;
  } else if (range == 2) {
    shape = two();
  } else if (range == 3) {
    shape = three();
  }

  return linear_extrude({ height: 2.8 }, shape.scale(0.15))
    .rotateZ(-90)
    .translate([(range * 100) + 2.6, 12 - centreOffset, 0]);
}

function range(namefn, factionfn) {
  var body = linear_extrude({ height: 2.8 }, square({ size: [300, 12], center: false}));

  return union(
    body
      .subtract(notch(1))
      .subtract(wedge(1))
      .subtract(sideWedge(1))
      .subtract(notch(2))
      .subtract(wedge(2))
      .subtract(sideWedge(2))
      .subtract(notch(3))
      .subtract(wedge(3))
      .subtract(faction(factionfn))
      .subtract(name(namefn))
      .subtract(tidyEnd()),
    rangeNumber(1),
    rangeNumber(2),
    rangeNumber(3)
  );
}

function main() {
  var rulers = [range(adam, imperial)],
      i, models;
  for (i = 0, models = []; i < rulers.length; i++) {
    models.push(rulers[i].translate([0, 14 * i, 0]));
  }
  return models;
}
